import React, { Component } from 'react';
import "../App.css"

const Card = ({ title, content }) => {
    return (
        <div class="card" >
            <div className='card-heading'>
            <div class="card-body">
                <h5 class="card-title">{title}</h5>
                <p class="card-text">{content}</p>
                <a href="#" class="btn btn-primary">Go somewhere</a>
            </div>
            </div>
        </div>
    );
};

export default Card;
